/*! \brief identifies the closes node in the graph to a given point
*  param[in] point
* \return ID of the closest node in the graph
*/
int identifyClosestNode(std::pair<int, int> point)
{
	float distance, shortestDistance = sqrt(3000 * 3000 + 2000 * 2000);
	int   index, shortestID;
	std::pair<int, int> point2;

	//! go through the entire node list
	for (index = 0; index<(int)nodes.size(); index++)
	{
		//! compute the distance
		point2.first = nodes.at(index)->pos.first;
		point2.second = nodes.at(index)->pos.second;
		distance = get_Distance(point, point2);

		//! if the distance is shorter, update the shortest ID and shortest dist
		if (distance<shortestDistance)
		{
			shortestDistance = distance;
			shortestID = index;
		}
	}
	return shortestID;
}

/*! \brief gets the distance between two points in the graph by taking through
* the optimal path as defined by the dijkstra algorithm.
*  param[in] start position in [mm]
*  param[in] goal position in [mm]
* \return distance in [mm]
*/
double getDistanceFromAtoB(std::pair<int, int> startPos, std::pair<int, int> goalPos)
{
	int startID = identifyClosestNode(startPos);
	int goalID = identifyClosestNode(goalPos);
	double distance = 0;
	int i;


	//! if the path is not empty
	if (!m_paths[startID][goalID].empty())
	{
		//! add the  distance from the start point and the closest node
		distance += get_Distance(startPos, nodes.at(startID)->pos);
		//! add the distance between the start node and the first node on the path
		distance += get_Distance(nodes.at(startID)->pos, nodes.at(m_paths[startID][goalID].at(0))->pos);

		//! if the path is made up of more than one intermediate point
		if ((int)m_paths[startID][goalID].size()>1)
		{
			//! go through all the intermediate points
			for (i = 1; i<(int)m_paths[startID][goalID].size(); i++)
			{
				//! identify current and previous nodes
				std::pair<int, int> prevPos = nodes.at(m_paths[startID][goalID].at(i - 1))->pos;
				std::pair<int, int> currentPos = nodes.at(m_paths[startID][goalID].at(i))->pos;
				//! sum the distance between the two nodes to the previous distances
				distance += get_Distance(prevPos, currentPos);
			}
		}

		//! add the distance from the estimated goal and the true goal
		distance += get_Distance(nodes.at(goalID)->pos, goalPos);
	}
	else
	{
		//! if there is no path, the distance is the distance from the start to the goal
		distance += get_Distance(startPos, goalPos);
	}

	return distance;
}

/*! \brief depricated.
*  Gets the path from a starting point to a goal and stores in the given vector
*  of IDs
*  param[in] start and goal coordinates
*  param[in] the vector to store the path
*/
void getPath(std::vector<int> *path, int start[2], int goal[2])
{
	std::pair<int, int> startPos(start[0], start[1]);
	std::pair<int, int> goalPos(goal[0], goal[1]);
	int startID = identifyClosestNode(startPos);
	int goalID = identifyClosestNode(goalPos);


	//! if the path is not empty
	if (!m_paths[startID][goalID].empty())
	{
		//! store the path
		*path = m_paths[startID][goalID];
	}
	else
	{
		//! if there is no stored path, go straight to the goal
		path->push_back(goalID);
	}
}

/*! \brief DEPRICATED
*  gets the path from a starting point to a goal and stores in the given vector
*  of IDs
*  param[in] start position in [mm]
*  param[in] goal position in [mm]
* \return vector of intermediate target IDs to the goal
*/
std::vector<int> getPath(std::pair<int, int> startPos, std::pair<int, int> goalPos)
{
	int startID = identifyClosestNode(startPos);
	int goalID = identifyClosestNode(goalPos);

	//! return the path from the start to the goal
	return m_paths[startID][goalID];
}

