/*! Code adapted from :http://www.geeksforgeeks.org/printing-paths-dijkstras-shortest-path-algorithm/
* \brief A utility function to find the vertex with minimum distance
*  value, from the set of vertices not yet included in shortest
*  path tree
*  param[in] distance table
*  param[in] table indicating whether the node was visited or not
* \return index of the node that is the closest to the starting point
*/

int minDistance(int dist[], bool sptSet[])
{
	//! Initialize min value
	int min = INT_MAX, min_index;

	//! for all the nodes
	for (int n = 0; n < NUMNODE; n++)
		//! if the node is unvisited and the considered distance is inferior to the min distance
		if (sptSet[n] == false && dist[n] <= min)
			//! update the minimum distance and minimun index
			min = dist[n], min_index = n;

	//! return the ID of the node with the minimum distance
	return min_index;
}

/*! Code adapted from :http://www.geeksforgeeks.org/printing-paths-dijkstras-shortest-path-algorithm/
* \brief Function to store the shortest path from source to j using parent array
*  param[in] parent list
*  param[in] index of the considered node
*  param[in] path vector to store the list of intermediate nodes
*/
void storePathForNodej(int parent[], int j, std::vector<int> *path)
{
	//! Base Case : If j is the source node
	if (parent[j] == -1)
		return;

	//! if the considered node is not the source node, keep looking through the parents
	storePathForNodej(parent, parent[j], path);
	//! add the current node to the path
	path->push_back(j);
	//	printf("%d ", j);
}

/*! Code adapted from :http://www.geeksforgeeks.org/printing-paths-dijkstras-shortest-path-algorithm/
* \brief A utility to store the constructed distance array
*  param[in] table with distances
*  param[in] table with the parent lists
*  param[in] considered source node
*/
void storeAllPathsFromSourceNode(int dist[], int parent[], int src)
{
	//! for all the nodes
	for (int i = 0; i < NUMNODE; i++)
	{
		//! identify the path from the source node to the node i
		m_paths[src][i].push_back(src);
		storePathForNodej(parent, i, &m_paths[src][i]);
	}
}

/*! Code adapted from :http://www.geeksforgeeks.org/printing-paths-dijkstras-shortest-path-algorithm/
* \brief Funtion that implements Dijkstra's single source shortest path
*  algorithm for a graph represented using adjacency matrix representation
*  param[in] graph to store the distances in [mm] between all connected nodes
*  param[in] ID of the considered source node
*/
void dijkstra(int graph[NUMNODE][NUMNODE], int src)
{
	int dist[NUMNODE];  //! Q The output array. dist[i] will hold
						//! the shortest distance from src to i

						//! sptSet[i] will true if vertex i is included / in shortest
						//! path tree or shortest distance from src to i is finalized
	bool sptSet[NUMNODE];

	//! Parent array to store shortest path tree
	int parent[NUMNODE];
	parent[src] = -1;


	//! Initialize all distances as INFINITE and stpSet[] as false
	for (int i = 0; i < NUMNODE; i++)
	{
		dist[i] = INT_MAX; //! set all distances to infinity
		sptSet[i] = false; //! not included in the shortest path
	}

	//! Distance of source vertex from itself is always 0
	dist[src] = 0;

	//! Find shortest path for all vertices
	for (int count = 0; count < NUMNODE - 1; count++)
	{
		//! Pick the minimum distance vertex from the set of
		//! vertices not yet processed. u is always equal to src
		//! in first iteration.
		int u = minDistance(dist, sptSet);

		//! Mark the picked vertex as processed
		sptSet[u] = true;

		//! Update dist value of the adjacent vertices of the
		//! picked vertex.
		for (int n = 0; n < NUMNODE; n++)

			//! Update dist[v] only if is not in sptSet, there is
			//! an edge from u to v, and total weight of path from
			//! src to v through u is smaller than current value of
			//! dist[v]
			if (!sptSet[n] && graph[u][n] &&
				dist[u] + graph[u][n] < dist[n])
			{
				parent[n] = u;
				dist[n] = dist[u] + graph[u][n];
			}
	}

	//! store the constructed distance array
	storeAllPathsFromSourceNode(dist, parent, src);
}

